const footerData = [
	{
		title: 'Orders and support',
		data: [
			'Contact us',
			'FAQs',
			'Shipping',
			'Returns',
			'Terms and Conditions',
		],
	},
	{
		title: 'Services',
		data: ['Life assistance', 'Corporate gifts', 'Facial appointments'],
	},
	{
		title: 'Location preferences',
		data: ['Shipping: Hong KOng(S.A.R', 'Language: English'],
	},
	{
		title: 'Sustainability',
		data: [
			'All Aesop products are vegan, and we do not test our formulations or ingredients on animals. We are Leaping Bunny approved and a Certified B Corporation. Learn more',
		],
	},
	{
		title: 'About',
		data: [
			'Our story',
			'Foundation',
			'Careers',
			'privacy policy',
			'Accessibility',
		],
	},
	{
		title: 'Social Media',
		data: ['Instagram', 'Twitter', 'LinkedIn', 'Wechat', 'Weibo'],
	},
];

export default footerData;
